  false,\n\t\"url\": null,\n\t\"notes\": \"This report covers the distribution, abundance,
  and productivity of fall staging lesser snow geese on coastal habitats of northeast
  Alaska and northwest Canada. The fall staging of lesser snow geese using the coastal
  plain of the Arctic National Wildlife Refuge and adjacent Yukon and Northwest Territories
  was monitored. Objectives were to determine chronology of migration and staging,
  estimate the distribution, and estimate the age ratio, identify habitat types, and
  document daily activities.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
